import React from 'react';
import logo  from './img/Logo.svg';


function Navbar() {
  return (
    <div className="home">
     <nav>
        <img src={logo} alt="Logo" className="logo" />
         <ul>
             li
         </ul>

     </nav>
    </div>
  );
}

export default Navbar;
